import React from 'react';

function LightOnPACE() {
  return (
    <div>
      <h2>Arrojando Luz sobre PACE</h2>
      <h3>Sección I: Propiedades fundamentales de la luz</h3>
      <h3>Sección II: ¿Qué determina el color que vemos?</h3>
      <h3>Sección III: ¿Cómo interactúa la atmósfera con la luz?</h3>
      <h3>Sección IV: ¿Cómo interactúa el océano con la luz?</h3>
      <p>PACE - ¡TODO SUMA!</p>
    </div>
  );
}

export default LightOnPACE;
